  false,\n\t\"url\": null,\n\t\"notes\": \"This report details field work completed
  on Middleton Island during the summer of 1983. These data are part of an ongoing
  study and interpretations of them may well change in future years. The authors should
  be consulted before using information in this report. Seven species of seabirds,
  one species of goose, at least four species of ducks, and five species of shorebirds
  breed on Middleton. The Pelagic Cormorant (Phalacrocorax pelagicus) and Black-legged
  Kittiwake (Rissa tridactyla) colonies there are among the largest in the state.
  Northern sea lions (Eumetopias jubata) and Harbor Seals (Phoca vitulina) use the
  island as a haul out station and the seals breed here.\",\n\t\"license_title\":
